from qutip import *
from math import sqrt, cos, sin
import numpy as np
from gen_state import make_W_list
from rho_methods_ONLYGOOD import compute_witnesses, get_rho
import matplotlib.pyplot as plt


# Basis Notes: 
H = basis(2,0) # ket 1
V = basis(2,1) # ket 2
D = 1/sqrt(2) * (H + V)
A = 1/sqrt(2) * (H - V)
R = 1/sqrt(2)*(H + 1j*V)
L = 1/sqrt(2)*(H - 1j*V)

# scan over chi and eta
chiL = np.linspace(0,2*np.pi, 3)
etaL = np.linspace(0,2*np.pi, 3)[1:]

# 1: HL, 2: VR, 3: VL, 4: HR
state_D = {1:[], 2:[], 3:[], 4:[]} # HL and VR should have no values after loop, VL and HR should have values

state_HL_L = []
state_VR_L = []
state_VL_L = []
state_HR_L = []


iter = 0
for eta in etaL:
    for chi in chiL:
        # ensure each of our states is normalized with this factor 
        norm_factor = (1 + 0.5*cos(chi)*sin(2*eta))**0.5

        # make HL state
        state_HL = cos(eta)*tensor(H,L) + sin(eta)*np.exp(1j*chi)*tensor(H,L)
        state_HL = state_HL/norm_factor

        # make VR state
        state_VR = cos(eta)*tensor(V,R) + sin(eta)*np.exp(1j*chi)*tensor(V,R)
        state_VR = state_VR/norm_factor

        # make VL state
        state_VL = cos(eta)*tensor(V,L) + sin(eta)*np.exp(1j*chi)*tensor(V,L)
        state_VL = state_VL/norm_factor

        # make HR state
        state_HR = cos(eta)*tensor(H,R) + sin(eta)*np.exp(1j*chi)*tensor(H,R)
        state_HR = state_HL/norm_factor

        # should not be witnessed
        rho_HL = ket2dm(state_HL).full()
        rho_VR = ket2dm(state_VR).full()

        # should be witnessed
        rho_VL = ket2dm(state_VL).full()
        rho_HR = ket2dm(state_HR).full()

        rho_L = [rho_HL, rho_VR, rho_VL, rho_HR]
        for j in range(len(rho_L)):
            print(iter)
            wit_L, wit_params = compute_witnesses(rho_L[j])
            min_wit = min(wit_L)
            if min_wit < 0:
                min_index = wit_L.index(min_wit)
                state_D[j+1] += [(min_index, min_wit, (np.degrees(eta), np.degrees(chi)),np.degrees(wit_params[min_index]))]
            iter+=1

print(state_D)

